BEGIN TRANSACTION;
CREATE TABLE xplayerspositions (steamID VARCHAR UNIQUE, posX REAL, posY REAL, posZ REAL);
CREATE TABLE vehicles (vehicleid INTEGER PRIMARY KEY AUTOINCREMENT, modelid INTEGER, pos VARCHAR, angle VARCHAR, col1 VARCHAR, col2 VARCHAR, ownerid VARCHAR, ownername VARCHAR, health FLOAT, price FLOAT, storage BLOB, trap INTEGER, guard INTEGER,template VARCHAR,decal VARCHAR,insurance FLOAT );
CREATE TABLE temp (position VARCHAR, text VARCHAR);
CREATE TABLE properties (position VARCHAR, text VARCHAR);
CREATE TABLE playerBounties (id INTEGER PRIMARY KEY, player VARCHAR, target VARCHAR, bounty INTEGER);
CREATE TABLE mutes ( steamID VARCHAR, name VARCHAR, duration BIGINT(255), date VARCHAR, reason VARCHAR, responsible VARCHAR, responsibleSteamID VARCHAR );
CREATE TABLE militarybases (position VARCHAR, text VARCHAR);
CREATE TABLE clans ( name VARCHAR UNIQUE, creator VARCHAR, tag VARCHAR, colour VARCHAR, creationDate VARCHAR, bank INT, type VARCHAR, motd VARCHAR );
CREATE TABLE clan_messages ( clan VARCHAR, type VARCHAR, message VARCHAR, date VARCHAR );
CREATE TABLE clan_members ( steamID VARCHAR UNIQUE, clan VARCHAR, name VARCHAR, rank VARCHAR, joinDate VARCHAR );
CREATE TABLE buymenu_players_appearances (steamid VARCHAR UNIQUE, head VARCHAR, covering VARCHAR, hair VARCHAR, face VARCHAR, neck VARCHAR, back VARCHAR, torso VARCHAR, righthand VARCHAR, lefthand VARCHAR, legs VARCHAR, rightfoot VARCHAR, leftfoot VARCHAR);
CREATE TABLE buymenu_players (steamid VARCHAR UNIQUE, model_id INTEGER);
CREATE TABLE buymenu_colors (steamid VARCHAR UNIQUE, r1 INTEGER, g1 INTEGER, b1 INTEGER, r2 INTEGER, g2 INTEGER, b2 INTEGER);
CREATE TABLE bans ( steamID VARCHAR, name VARCHAR, duration BIGINT(255), date VARCHAR, reason VARCHAR, responsible VARCHAR, responsibleSteamID VARCHAR );
CREATE TABLE bank_players (steamid VARCHAR UNIQUE, money INTEGER);
CREATE TABLE bank_apple (steamid VARCHAR UNIQUE, money INTEGER);
CREATE TABLE acl_members ( groups VARCHAR, steamID VARCHAR );
CREATE TABLE acl_groups ( name VARCHAR UNIQUE, creator VARCHAR, permissions VARCHAR, creationDate VARCHAR, tag VARCHAR, tagColour VARCHAR );
CREATE TABLE PlayerManager (steamid VARCHAR,xp VARCHAR,donor  VARCHAR,kills VARCHAR,deaths VARCHAR,reserve3 VARCHAR,reserve4 VARCHAR,reserve5 VARCHAR,reserve6 VARCHAR,reserve7 VARCHAR,reserve8 VARCHAR,reserve9 VARCHAR,reserve10 VARCHAR );
CREATE TABLE FriendTable (steamID VARCHAR UNIQUE, Friends BLOB, Requests BLOB, RequestedFriends BLOB);
COMMIT;
